import { Link } from 'react-router-dom';
import Web from '../pages/Web';
import Marketing from '../pages/Marketing';
import Credits from '../pages/Credits';
import { Routes, Route } from 'react-router-dom';

export default function Nav() {
    return (
     <div>
      {/* Container for text and navigation */}
      <div className='h-20 flex flex-col items-center'>
        {/* Text Container */}
        <div className='flex items-center justify-between w-full px-5'>
          <Link to="/home" className='font-mono mx-5'>
            CAMERON BRAMLEY
          </Link>
        </div>

        {/* Navigation Container */}
        <nav className='w-full px-5'>
          <ul className='flex justify-center space-x-6'>
            <li>
              <Link to="/web" className="hover:text-red-500">WEB</Link>
            </li>
            <li>
              <Link to="/marketing" className="hover:text-red-500">MARKETING</Link>
            </li>
            <li>
              <Link to="/credits" className="hover:text-red-500 text-green-500">CREDITS</Link>
            </li>
          </ul>
        </nav>
      </div>

      {/* Black bar below navigation */}
      <div className='w-full bg-black h-0.5 my-10'></div>
    </div>
    );
}
